class Stack:
    def __init__(self):
        self.stack = []

    def push(self, item):
        self.stack.append(item)

    def pop(self):
        return self.stack.pop()

    def count_different_numbers(self, other):
        count = 0
        for num in set(self.stack) & set(other.stack):
            if self.stack.count(num) != other.stack.count(num):
                count += 1
        return count

    def __len__(self):
        return len(self.stack)

